import "../styles/home.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="home">
      <div className="main">
        <div className="cat-one">
          <Link to="catalog"><img src="#" alt="#"></img></Link>dioramas
        </div>
        <div className="cat-two"><Link to="catalog"><img src="" alt="" ></img></Link>wargaming</div>
        <div className="cat-three"><Link to="catalog"><img src="" alt="" ></img></Link>terrain</div>
        <div className="cat-four"><Link to="catalog"><img src="" alt="" ></img></Link>military</div>
        <div className="cat-five"><Link to="catalog"><img src="" alt="" ></img></Link>railroad</div>
        <div className="cat-six">paint<Link to="catalog"><img src="" alt="" ></img></Link></div>
        <div className="cat-seven">brushes<Link to="catalog"><img src="" alt="" ></img></Link></div>
        <div className="cat-eight">gaming supplies<Link to="catalog"><img src="" alt="" ></img></Link></div>
        <div className="cat-nine"><Link to="catalog"><img src="" alt="" ></img></Link>model supplies</div>
        <div className="cat-ten"><Link to="catalog"><img src="" alt="" ></img></Link>mats</div>
      </div>
      <hero></hero>
    </div>
  );
};

export default Home;
